import "./List.css";
const ListData = (props) => {
  const catg = props.data;
  const clickedItem = (event) => {
    console.log(event.target.id);
  };
  return (

    <ul class="list-group">
          console.log(catg[0]);
      {catg &&
        catg.length > 0 &&
        catg.map((catg, index) => (
          <div className="list">
            <li
              class="list-group-item"
              key={catg.id}
              onClick={clickedItem}
              id={catg.id}
            >
              <div className="row" id={catg.id}>
                <img
                  className="image"
                  src={catg.foodCategoryImagepath}
                  alt="new"
                  id={catg.id}
                />
                <div className="text" id={catg.id}>
                  {catg.name}
                </div>
              </div>
            </li>
          </div>
        ))}
    </ul>
  );
};

export default ListData;
